	        var data = getData(color);
	        for (var i = 0; i < 3; i++) {
	            if (direct === 1) {
	                data[i] = data[i] * (1 - level) | 0;
	            } else {
	                data[i] = (255 - data[i]) * level + data[i] | 0;
	            }
	        }
