	            var h = parseInt(hsxa[0], 0) / 360;
	            var s = hsxa[1];
	            var x = hsxa[2];
	            a = hsxa[3];
	            data = map([s, x], function (c) {
	                return adjust(parseFloat(c) / 100, [0, 1]);
	            });
